(16342, 'vn', 'these_images_are_visible_in_product_details_page_gallery_use_600x600_sizes_images', 'Những hình ảnh này có thể nhìn thấy trong thư viện trang chi tiết sản phẩm. Sử dụng hình ảnh kích thước 600x600.', '2021-02-09 08:05:52', '2021-09-20 07:29:56'),
(16343, 'vn', 'this_image_is_visible_in_all_product_box_use_300x300_sizes_image_keep_some_blank_space_around_main_object_of_your_image_as_we_had_to_crop_some_edge_in_different_devices_to_make_it_responsive', 'Hình ảnh này có thể nhìn thấy trong tất cả các hộp sản phẩm. Sử dụng hình ảnh kích thước 300x300. Giữ một số không gian trống xung quanh đối tượng chính của hình ảnh của bạn vì chúng tôi phải cắt một số cạnh trong các thiết bị khác nhau để làm cho nó phản hồi.', '2021-02-09 08:05:52', '2021-09-20 07:29:56'),
