(17811, 'lk', '2_you_can_download_the_example_file_to_understand_how_the_data_must_be_filled', '2. தரவு எவ்வாறு நிரப்பப்பட வேண்டும் என்பதைப் புரிந்து கொள்ள உதாரணக் கோப்பைப் பதிவிறக்கலாம்.', '2021-02-09 08:13:51', '2021-09-20 07:30:01'),
(17812, 'lk', '3_once_you_have_downloaded_and_filled_the_skeleton_file_upload_it_in_the_form_below_and_submit', '3. நீங்கள் எலும்புக்கூடு கோப்பை பதிவிறக்கம் செய்து பூர்த்தி செய்தவுடன், அதை கீழே உள்ள படிவத்தில் பதிவேற்றி சமர்ப்பிக்கவும்.', '2021-02-09 08:13:51', '2021-09-20 07:30:01'),
(17813, 'lk', '4_after_uploading_products_you_need_to_edit_them_and_set_products_images_and_choices', '4. தயாரிப்புகளை பதிவேற்றிய பிறகு நீங்கள் அவற்றைத் திருத்த வேண்டும் மற்றும் தயாரிப்புகளின் படங்களையும் தேர்வுகளையும் அமைக்க வேண்டும்.', '2021-02-09 08:13:51', '2021-09-20 07:30:01'),
