(18176, 'lk', 'seller_wise_flat_shipping_cost_calulation_fixed_rate_for_each_seller_if_a_customer_purchase_2_product_from_two_seller_shipping_cost_is_calculate_by_addition_of_each_seller_flat_shipping_cost', 'விற்பனையாளர் வைஸ் பிளாட் ஷிப்பிங் செலவு கணக்கீடு: ஒவ்வொரு விற்பனையாளருக்கும் நிலையான வீதம். ஒரு வாடிக்கையாளர் இரண்டு விற்பனையாளர் கப்பல் செலவில் இருந்து 2 தயாரிப்பு வாங்கினால், ஒவ்வொரு விற்பனையாளரின் பிளாட் ஷிப்பிங் செலவையும் சேர்த்து கணக்கிடப்படுகிறது', '2021-02-09 08:14:00', '2021-09-20 07:30:02'),
