(18799, 'lk', 'this_is_used_for_search_input_those_words_by_which_cutomer_can_find_this_product', 'இது தேடலுக்குப் பயன்படுத்தப்படுகிறது. கட்டோமர் இந்த தயாரிப்பைக் கண்டுபிடிக்கக்கூடிய சொற்களை உள்ளிடவும்.', '2021-02-09 08:15:33', '2021-09-20 07:30:04'),
(18800, 'lk', 'these_images_are_visible_in_product_details_page_gallery_use_600x600_sizes_images', 'இந்த படங்கள் தயாரிப்பு விவரங்கள் பக்க கேலரியில் தெரியும். 600x600 அளவிலான படங்களைப் பயன்படுத்தவும்.', '2021-02-09 08:15:33', '2021-09-20 07:30:04'),
(18801, 'lk', 'this_image_is_visible_in_all_product_box_use_300x300_sizes_image_keep_some_blank_space_around_main_object_of_your_image_as_we_had_to_crop_some_edge_in_different_devices_to_make_it_responsive', 'இந்த படம் எல்லா தயாரிப்பு பெட்டியிலும் தெரியும். 300x300 அளவிலான படத்தைப் பயன்படுத்தவும். உங்கள் படத்தின் முக்கிய பொருளைச் சுற்றி சில வெற்று இடத்தை வைத்திருங்கள், ஏனெனில் நாங்கள் அதை பதிலளிக்க பல்வேறு சாதனங்களில் சில விளிம்புகளை செதுக்க வேண்டியிருந்தது.', '2021-02-09 08:15:33', '2021-09-20 07:30:04'),
(18802, 'lk', 'use_proper_link_without_extra_parameter_dont_use_short_share_linkembeded_iframe_code', 'கூடுதல் அளவுரு இல்லாமல் சரியான இணைப்பைப் பயன்படுத்தவும். குறுகிய பங்கு இணைப்பு / உட்பொதிக்கப்பட்ட ஐஃப்ரேம் குறியீட்டைப் பயன்படுத்த வேண்டாம்.', '2021-02-09 08:15:33', '2021-09-20 07:30:04'),
